import React from "react";
import GeneradorTextoChatbot from "./GeneradorTextoChatbot";

function Chat() {
  const sessionId = localStorage.getItem("id_sesion");
  const nombreUsuario = localStorage.getItem("nombre_usuario");

  return (
    <div>
      <h1>Chat con el Asistente</h1>
      <GeneradorTextoChatbot sessionId={sessionId} nombreUsuario={nombreUsuario} />
    </div>
  );
}

export default Chat;
